INSERT INTO `journal_encounter_section_locale` (`ID`, `locale`, `Title_lang`, `BodyText_lang`, `VerifiedBuild`) VALUES
(30861, 'esES', 'DPS', '$bullet;Aleja a los incendiarios de la banda. La explosión de |cFF2959D3|Hspell:464983|h[Antorcha]|h|r es grande e inflige mucho daño.\n$bullet;Los caminallamas lanzan |cFF2959D3|Hspell:470164|h[Infusión de magma]|h|r hasta que caen derrotados, lo que dificulta el tránsito por la Cámara de Hierro.\n$bullet;Los jugadores deberían destruir las anclas del portal lo más rápido posible mientras se aseguran de que los espíritus ardientes no lanzan |cFF2959D3|Hspell:464769|h[Furia de las Tierras de Fuego]|h|r.', 57534),
(30900, 'esES', 'Resumen', 'El emperador Dagran Thaurissan y la princesa Moira Barbabronce son unos combatientes formidables. Habrá que necesario gestionar con cuidado |cFF2959D3|Hspell:466504|h[Palabra de las Sombras: némesis]|h|r y |cFF2959D3|Hspell:470599|h[Palabra de las Sombras: necrosis]|h|r de Moira para que no arrollen a la banda. Moira intentará sanar a Dagran con |cFF2959D3|Hspell:470605|h[Infusión radiante]|h|r.\n\nDagran es un combatiente cuerpo a cuerpo peligroso que usará las facultades |cFF2959D3|Hspell:465077|h[Llamar a guardia imperial]|h|r e |cFF2959D3|Hspell:465079|h[Invocar embajador del Martillo Crepuscular]|h|r para repeler a los invasores. Tras derrotar a Moira, se transformará en un poderoso |cFF2959D3|Hspell:465069|h[Avatar de la Llama]|h|r y potenciará todas sus facultades.\n\nCuando se desespere, intentará salvarse con un |cFF2959D3|Hspell:466332|h[Ruego al Señor del Fuego]|h|r. El avatar de Ragnaros desatará una devastación que llenará poco a poco toda la sala de fuego de arrabio hasta que Dagran caiga derrotado. Dagran dejará de llamar a la guardia imperial y a los embajadores del Martillo Crepuscular cuando Ragnaros se una a la batalla.', 57534),
(31073, 'esES', '', '', 57534),
(30986, 'esES', 'Sección 24', '', 57534),
