(30722, 'esES', 'Resumen', 'Lord Roccor lanza |cFF2959D3|Hspell:462351|h[Magma arrollador]|h|r a su objetivo, lo que inflige daño y proporciona materias primas para |cFF2959D3|Hspell:463674|h[Cristalizar]|h|r a su progenie de obsidiana.\n\nCuando lord Roccor alcance el 95% de salud, y por cada 20% de daño que sufra de ahí en adelante, lanzará |cFF2959D3|Hspell:462322|h[Erupción]|h|r, lo que llenará la habitación de |cFF2959D3|Hspell:462351|h[Magma arrollador]|h|r. Cada |cFF2959D3|Hspell:462346|h[Magma viviente]|h|r que alcance su destino aumentará el poder del elemental creado por |cFF2959D3|Hspell:462320|h[Cristalización ígnea]|h|r.\n\nAl llegar a 100 p. de energía, Roccor lanza |cFF2959D3|Hspell:462317|h[Agitación volcánica]|h|r para infligir un enorme daño a todos los jugadores.', 57534),
(5499, 'esES', 'Fisura de las Sombras inferior', 'El brujo supremo Malbisal crea una fisura de consumo bajo un jugador, que recibe $30498s1 p. de daño de las Sombras cada $30498t1 s mientras está dentro de ella.', 57534),
(30988, 'esES', 'Sección 27', '', 57534),
(30760, 'esES', 'Sección 5', '', 57534),
(4910, 'esES', 'Salva', 'Illyanna Roblecuervo dispara una salva de flechas a todos los jugadores en un área de $30933A1 m de ancho. La salva inflige $448891s1 p. de daño Arcano cada $448891t1 s durante $30933d.', 57534);
