INSERT INTO `scenario_step_locale` (`ID`, `locale`, `Description_lang`, `Title_lang`, `VerifiedBuild`) VALUES
(6762, 'esES', '¡Destapa y analiza runas ocultas por la zona!', 'Analiza las runas ocultas', 57534),
(6802, 'esES', 'Quita el polvo a los huesos para que puedan estudiarlos', '¡Limpia los huesos!', 57534),
(6552, 'esES', '¡Lanza sombreros a los elementales impacientes para reclutarlos como archivistas ayudantes!', 'Recluta elementales impacientes', 57534),
(6765, 'esES', '¡Destapa y analiza las reliquias por la zona!', 'Analiza las reliquias antiguas', 57534),
(6549, 'esES', '', '¡Prepárate para luchar!', 57534),
(6200, 'esES', '¡Repara las palas y colócalas para los demás archivistas!', 'Repara las palas', 57534),
(6584, 'esES', '¡Derrota a los agentes despiertos de Neltharion que tienden emboscadas a la excavación!', 'Elimina agentes despiertos', 57534),
(6578, 'esES', '¡Destapa y analiza runas ocultas por la zona!', 'Analiza las runas ocultas', 57534),
(6760, 'esES', '¡Entrega un cajón de artefactos a Zenata para que los estudie!', 'Entrega para Zenata', 57534),
(6803, 'esES', '¡Los alfazaques de biblioteca son una amenaza para nuestra investigación! Pisotéalos.', '¡Pisotea los alfazaques de biblioteca!', 57534),
(6204, 'esES', '¡El espíritu del Reposo del Traidor ataca! ¡Debemos proteger el lugar para volver a cavar otro día!', '¡El fin del Reposo del Traidor!', 57534),
(6202, 'esES', '¡Los escritos de Nirobin están desperdigados! Devuelve los correctos a la estantería y los incorrectos a la oficina.', 'Devuelve los tomos desperdigados', 57534),
(6191, 'esES', 'Acércate a Eadweard y espera sus instrucciones.', '¡Comienza la búsqueda de conocimientos!', 57534),
(6407, 'esES', '¡Canaliza hacia los familiares nutrias de Nirobin para liberar a sus equivalentes buscapistas!', '¡Libera a las nutrias!', 57534),
(6539, 'esES', '¡Los djaradin ancestrales se han alzado y atacan! ¡Protege la zona frente a su agresión!', 'Repele a los djaradin espectrales', 57534),
(6406, 'esES', 'Entrega cuencos de calderoth a los archivistas hambrientos.', 'Alimenta a los archivistas', 57534),
(6197, 'esES', '¡Excava los enormes huesos de dragón!', 'Exhuma huesos de dragón', 57534),
(6201, 'esES', '¡Rompe las rocas y quita luego los fragmentos!', 'Rompe y retira las rocas', 57534),
(6195, 'esES', '¡Resalta y analiza las reliquias alrededor del esqueleto!', 'Analiza las reliquias antiguas', 57534),
(6196, 'esES', '¡Inspecciona la tierra perturbada y excava en busca de artefactos!', 'Inspecciona la zona', 57534),
(6193, 'esES', 'Elimina la maleza y las hierbas de la zona.', 'Elimina la reposahierba', 57534),
(6764, 'esES', '¡Destapa y analiza las reliquias por la zona!', 'Analiza las reliquias antiguas', 57534),
(6805, 'esES', 'Habla con Zenata para conseguir algunas runas y llevarlas al campamento principal', '¡Runas de Zenata!', 57534),
(6553, 'esES', '¡Prepara el equipo en una ubicación remota importante!', 'Prepara una excavación satélite', 57534),
(6551, 'esES', '¡Trae sombreros para enfriar a los archivistas quemados por el sol en el campo!', 'Da sombra a los archivistas quemados por el sol', 57534),
(6806, 'esES', 'Habla con Nirobin para conseguir algunos libros y llevarlos al campamento principal', '¡Libros de Nirobin!', 57534),
(6627, 'esES', '¡Estamos en racha! Quédate cerca de Eadweard y espera instrucciones. Excavando, que es gerundio.', '¡Falta poco para un descubrimiento!', 57534),
(6199, 'esES', '¡Separa las piedras entre rocas con relevancia histórica y simples rocas!', 'Clasifica las piedras significativas', 57534),
(6763, 'esES', '¡Destapa y analiza runas ocultas por la zona!', 'Analiza las runas ocultas', 57534),
(6542, 'esES', '¡Usa a Hap\'he para recoger pistas por la zona!', 'Reúne pistas de investigación', 57534),
(6544, 'esES', '¡Utiliza a tu familiar nutria para vencer y reunir pistas rebosantes de información!', 'Reúne pistas rebosantes de información', 57534),
(6804, 'esES', 'Habla con Roska para conseguir algunas palas y llevarlas al campamento principal', '¡Palas de Roska!', 57534),
(6198, 'esES', '¡Inspecciona las piedras de la zona en busca de valor arqueológico!', 'Inspecciona las piedras', 57534),
(6774, 'esES', '¡Entrega un cajón de artefactos a Roska para que los estudie!', 'Entrega para Roska', 57534),
(6775, 'esES', '¡Entrega un cajón de artefactos a Nirobin para que los estudie!', 'Entrega para Nirobin', 57534),
(6541, 'esES', '¡Los elementos nos atacan! ¡Protege nuestra zona de ellos!', 'Repele a los elementales perturbados', 57534),
(6543, 'esES', '¡Usa a Hap\'he para encontrar pistas jugosas por la zona!', 'Recoge pistas de investigación', 57534),
(6194, 'esES', '¡Los gnolls atacan! ¡Repélelos para proteger el lugar!', 'Repele a los gnolls', 57534),
(12556, 'esES', 'Derrota al magistrado Barthilas.', 'Magistrado Barthilas derrotado', 57534),
(12555, 'esES', 'Derrota a los avizores Guardia Negra y entra en los dominios de lord Aurius Osahendido.', 'Lord Aurius Osahendido', 57534),
